    true,nt"url": null,nt"notes": "<p>Data set merges information about the
    Centers for Medicare and Medicaid Services, Medicare and Medicaid EHR Incentive
    Programs attestations with the Office of the National Coordinator for Health IT
    Certified Health IT Products List. This new dataset enables systematic analysis
    of the distribution of certified EHR vendors and products among those providers
    that have attested to meaningful use within the CMS EHR Incentive Programs. The
    data set can be analyzed by state, provider type, provider specialty, and practice
    setting.</p>n",nt"license_title": "Other License Specified",nt"extras":
